import React, { useState } from 'react';

const Dashboard = () => {
  const [exerciseData, setExerciseData] = useState({
    date: '',
    exercises: [],
  });

  const [mealData, setMealData] = useState({
    date: '',
    meals: [],
  });

  const handleExerciseSubmit = (e) => {
    e.preventDefault();
    // Логика сохранения данных по упражнениям в базу данных
    console.log('Сохранение данных упражнений:', exerciseData);
    // Очистить состояние после сохранения
    setExerciseData({
      date: '',
      exercises: [],
    });
  };

  const handleMealSubmit = (e) => {
    e.preventDefault();
    // Логика сохранения данных по приемам пищи в базу данных
    console.log('Сохранение данных приемов пищи:', mealData);
    // Очистить состояние после сохранения
    setMealData({
      date: '',
      meals: [],
    });
  };

  return (
    <div>
      <h2>Dashboard</h2>
      <form onSubmit={handleExerciseSubmit}>
        <label>Date:
          <input type="date" value={exerciseData.date} onChange={(e) => setExerciseData({ ...exerciseData, date: e.target.value })} />
        </label>
        <label>Exercise Name:
          <input type="text" value={exerciseData.exercises.name} onChange={(e) => setExerciseData({ ...exerciseData, exercises: { ...exerciseData.exercises, name: e.target.value } })} />
        </label>
        <label>Category:
          <input type="text" value={exerciseData.exercises.category} onChange={(e) => setExerciseData({ ...exerciseData, exercises: { ...exerciseData.exercises, category: e.target.value } })} />
        </label>
        {/* Добавьте остальные поля в соответствии с вашей моделью данных */}
        <button type="submit">Save Exercise Data</button>
      </form>

      <form onSubmit={handleMealSubmit}>
        <label>Date:
          <input type="date" value={mealData.date} onChange={(e) => setMealData({ ...mealData, date: e.target.value })} />
        </label>
        <label>Meal Name:
          <input type="text" value={mealData.meals.name} onChange={(e) => setMealData({ ...mealData, meals: { ...mealData.meals, name: e.target.value } })} />
        </label>
        {/* Добавьте остальные поля в соответствии с вашей моделью данных */}
        <button type="submit">Save Meal Data</button>
      </form>
    </div>
  );
};

export default Dashboard;
